import React, { useState } from 'react';
import './styles.css';

function CheckVolunteerHistory() {
  const [searchQuery, setSearchQuery] = useState('');
  const [history, setHistory] = useState([]);

  const handleSearch = (e) => {
    e.preventDefault();
    // Fetch the history data from your backend here
    // setHistory(response.data);
  };

  return (
    <div className="history-container">
      <h2>Check Volunteer History</h2>
      <form onSubmit={handleSearch}>
        <input
          type="text"
          placeholder="Enter Member Number or Name"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        <button type="submit">Search</button>
      </form>
      <div className="history-list">
        {history.map((record, index) => (
          <div key={index} className="history-record">
            <p>{record.date}</p>
            <p>{record.activity}</p>
            <p>{record.points}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default CheckVolunteerHistory;
